INSERT INTO `notice` VALUES (1,'첫번째 공지입니다 :)','안녕하세요 여러분!!\r\n드디어 i Taxi가 나왔습니다 (짝짝짝!!)\r\n\r\ni Taxi는 날짜, 시간, 장소에 따라 택시 또는 카풀을 함께 할 사람을 구하는 커뮤니티입니다.\r\n친구들과 함께 가입하여 많이 이용해주세요 :)\r\n\r\n앞으로도 한동인들의 편의를 위해 더욱 노력하겠습니다.\r\n감사합니다.\r\n\r\np.s 불편사항은 hguitaxi@gmail.com 으로 문의주세요.','2015-07-20'),(2,'[★축★ iTaxi 1000명 돌파이벤트(~11/8)]','안녕하세요 학우여러분, i Taxi팀입니다!\r\n한 학기가 시작한지 벌써 반이 흘러갔네요.\r\n저희 서비스를 시작한지는 약 3달이 되어갑니다.\r\n그런데 드디어 여러분의 열화와 같은 성원에 힘입어 iTaxi 사용자가1000명을 돌파했습니다!(짝짝짝)\r\n\r\n그래서 이벤트로 11월8일까지, itaxi를 가장 많이 이용해주신 학우분 4분을 뽑아 히빈 쿠폰을 선물해드리려고 합니다. \r\n\r\n앞으로도 i Taxi 많이 많이 사랑해주세요^ㅡ^','2015-11-01'),(3,'[ iTaxi 1000명 돌파 이벤트] 상품 증정 완료!','이벤트 당첨자를 선정하던 중에, iTaxi를 여러번 이용해주신 분들이 생각보다 많아 놀랐습니다!!(감동) 히빈 쿠폰은 11/8 기준 가장 많이 이용해주신 분부터 순서대로 5분께 드렸습니다. 앞으로도 많이 이용해주세요! 감사합니다 ♡','2015-11-30');
